function Press(args)
	if args.key == string.byte("K") and LocalPlayer:GetValue("Fish") ~= 1 then
		LocalPlayer:SetValue("Fish", 1)
		Chat:Print("FISH FISH FISH", Color(75,75,255))
	elseif args.key == string.byte("K") and LocalPlayer:GetValue("Fish") == 1 then
		LocalPlayer:SetValue("Fish", 0)
		Chat:Print("HUMAN", Color(75,75,255))
	end
end
Events:Subscribe("KeyDown", Press)
function Fish()
	if LocalPlayer:GetValue("Fish") == 1 then
		LocalPlayer:SetBaseState(425)
	end
end
Events:Subscribe("SecondTick", Fish)
img = ""
timer = Timer()
pic1 = Image.Create(AssetLocation.Base64,img)
function Rend()
	if LocalPlayer:GetValue("Fish") == 1 then
		duration = 1
		origAlpha = 255 / duration
		alpha = ((origAlpha * timer:GetSeconds()) * (-1)) + 255
		alpha2 = alpha / 255
		if timer:GetSeconds() > 1 then
			alpha2 = (alpha / (-1)) / 255
		end
		pic1:SetAlpha(alpha2)
		pic1:Draw(Vector2(0,0),Render.Size,Vector2(0, 0),Vector2(1, 1))
		if timer:GetSeconds() > 2 then
			timer:Restart()
		end
	end
end
Events:Subscribe("Render", Rend)